import "./nav.module.css";

export const Nav = () => {
  return (
    <>
      <div>This is my Nav</div>;
      <div style={{ display: "flex", flexDirection: "row" }}>
        <Link href="/">
          <a>Home</a>
        </Link>
        <Link href="/about">
          <a>Abou</a>
        </Link>
        <Link href="/contact">
          <a>Contact</a>
        </Link>
      </div>
    </>
  );
};
